// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract Marketplace {
    address public admin;
    struct Listing {
        uint256 tokenId;
        address tokenAddress;
        uint256 price;
        address seller;
    }
    
    Listing[] public listings;

    constructor() {
        admin = msg.sender;
    }

    function listToken(uint256 tokenId, address tokenAddress, uint256 price) external {
        IERC721(tokenAddress).transferFrom(msg.sender, address(this), tokenId);
        listings.push(Listing(tokenId, tokenAddress, price, msg.sender));
    }

    function buyToken(uint256 index) external payable {
        Listing memory listing = listings[index];
        require(msg.value >= listing.price, "Insufficient payment");
        
        IERC721(listing.tokenAddress).transferFrom(address(this), msg.sender, listing.tokenId);
        
        payable(listing.seller).transfer(listing.price);
        
        listings[index] = listings[listings.length - 1];
        listings.pop();
    }
}
